import './App.css';
import React, { useState, useEffect } from 'react';

function App() {
  const [books, setBooks] = useState([]);

  useEffect(() => {
    fetch("/api/books/").then(response => response.json()).then(data => {
        setBooks(data.items)
        console.log(books)
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>{books.title}</p>
        <p>{books.author}</p>
        <p>{books.description}</p>
      </header>
    </div>
  );
}

export default App;
